-- ----------------------------
-- Function structure for areaNum
-- ----------------------------
DROP FUNCTION IF EXISTS `areaNum`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `areaNum`(`test` varchar(255)) RETURNS int(11)
BEGIN
	#Routine body goes here...
	#得到区域的总记录数
	DECLARE total  int default 0;
	select count(*) into total from  b_area WHERE b_area.delFlg='启用';
	RETURN total;
END
;;
DELIMITER ;
